ader)\n    Sworkers = data[\"workers\"]\n\n# Scheduler file name \nscheduler_info = 'scheduler.json'\n\n# Initialize the Deisa Adaptor \nAdaptor = Initialization(Sworkers, scheduler_info)\n\n# Check if client version is compatible with scheduler version\nAdaptor.client.get_versions(check=True)\n\n# Get data descriptor as a dict of Dask arrays\narrays = Adaptor.get_data()\n\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n   t = time.time()\n   # Get the Dask array global_t\n   gt = arrays[\"global_t\"]    \n   #gt = gt.rechunk({0: 1})\n   #print(gt.chunks)\n   # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"factors":["a","b"]},"id":"1155","type":"FactorRange"},{"attributes":{"axis":{"id":"1197"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"1199","type":"Grid"},{"attributes":{},"id":"1141","type":"ResetTool"},{"attributes":{"axis":{"id":"1263"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1266","type":"Grid"},{"attributes":{},"id":"1198","type":"CategoricalTicker"},{"attributes":{},"id":"1059","type":"ResetTool"},{"attributes":{"label":{"value":"read"},"renderers":[{"id":"1311"}]},"id":"1335","type":"LegendItem"},{"attributes":{"coordinates":null,"formatter":{"id":"1454"},"group":null,"major_label_policy":{"id":"1455"},"ticker":{"id":"1198"}},"id":"1197","type":"CategoricalAxis"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":
